import './index.css';

const Paginate = ({bookList}) => {
    console.log('paginate - ', Math.ceil(bookList.length/3))
    for (let x=1; x <= Math.ceil(bookList.length/3); x++) {
        console.log('paging -', x, Math.ceil(bookList.length/3))
    return (
        <div className="paginate-container">

            <button className="page">1</button>
        </div>
    )
    }
}

export default Paginate;
